rstring = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!@#$%^*(),./?;':[]{}"


def pick_word(o):
    return random.choice(o)


def build_passcode():
    counter = 0
    word = ""
    result = ""
    while counter < 6:

        # add a word from wordlist
        if random.randint(0, 1) == 0 and len(result) < 12:
            word = pick_word(wordlist)
            # prevent duplicates
            while word in result:
                word = pick_word(wordlist)
        # add a character from character string
        else:
            word = rstring[random.randint(0, len(rstring) - 1)]

        result += word
        word = ""
        counter += 1

    # loop the result and randomize the capitalization
    for idx, c in enumerate(result):
        result = result[0:idx] + (c.upper() if random.randint(0, 1) == 0 else c.lower()) + result[idx + 1:]

    return result


