def convert(input_file):
    try:
        with open(input_file, 'rb') as f:
            data = f.read()
            f.close()
            return ("".join("{:02x}".format(c) for c in data)).replace("0d0a", "0a")
    except (FileNotFoundError, IOError) as e:
            return("ERROR: File " + input_file + " can't be accessed. " + str(e))


def to_ascii(string):
    try:
        ba = bytearray.fromhex(string)
    except (ValueError, TypeError) as e:
        return("EXCEPTION: Input error -- " + str(e))
    else:
        ba = bytearray.fromhex(string)
        return ba.decode()


