# Check to make sure string is below target length
def compareLen(item_a, item_b, t_len):
    try:
        _t = len(item_a)
        _t = len(item_b)
    except TypeError:
        print("EXCEPTION: TypeError occurred")

    if (len(item_a) + len(item_b) < t_len):
        return True
    else:
        return False


def iterator(x):
    for y in x:
        yield y

def parseText(stringInput, targetLen):
    inputType = ""
    test = ""
    acceptedTypes = ["str", "list"]

    if str(type(stringInput).__name__) in acceptedTypes:
        # print(type(stringInput).__name__))
        inputType = str((type(stringInput).__name__))

        if inputType == "str":
            test = stringInput
        elif inputType == "list":
            targetLen += 4 # account for tab at beginning of each line
            try:
                for idx, word in enumerate(stringInput):
                    if isinstance(word, str):
                        # add quotes and commas for formatting
                        test = test + ("\"" + word + ("\", " if (idx < len(stringInput) - 1) else "\""))
                    if isinstance(word, int):
                        test = test + (str(word) + (", " if (idx < len(stringInput) - 1) else ""))
            except TypeError as e:
                print("EXCEPTION: TypeError -- " + str(e))

        spaceArray = [0]
        outputArray = [""]
        counter = 0

        for idx, c in enumerate(test):
            if (c == " "):
                spaceArray.append(idx)

        for i, v in enumerate(spaceArray):

            if (i < len(spaceArray) - 1):
                if compareLen(outputArray[counter], test[v:spaceArray[i + 1]], targetLen):
                    outputArray[counter] = (outputArray[counter] + (test[v:spaceArray[i + 1]])).strip()
                else:
                    outputArray.append(test[v:spaceArray[i + 1]].strip())
                    counter += 1

            elif compareLen(outputArray[counter], test[v:(len(test))], targetLen):
                outputArray[counter] = (outputArray[counter] + (test[v:(len(test))])).strip()
            else:
                outputArray.append(test[v:(len(test))].strip())
                counter += 1

        return outputArray

    return ["Unsupported input"]


